import React from "react";
import './Gif.css'
import { Link } from "wouter";

export default function Gif({title, id, url}) {
    return (
        <Link to={`#${id}`} className="Gif-link" >
            <h4>{title}</h4>
            <small>{id}</small>
            <img loading="lazy" alt={title} src={url} />
        </Link> 
    )
}
